import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink } from 'mdbreact';
import './Home.css';
import AnchorLink from 'react-anchor-link-smooth-scroll';
import Brand from'./Pics/brand.png';
import NavHome from './NavHome.js';

class Header extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      contacts: true
    };
    this.onClick = this.onClick.bind(this);

  }

  componentDidUpdate(){
    if (this.state.collapse) {
      this.setState({
      collapse:false
      });

    }

  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse,
    });
  }


  render() {

    const navigation = this.state.contacts ? (<NavHome/>)

      :(<NavContact/>);

    return (
      <div>
        <MDBNavbar color="elegant-color-dark" expand="md" fixed="top" scrolling transparent dark>
        <MDBNavbarBrand href="/">
          <img src={Brand} height="48px" width="48px" alt="" /><strong>easyvent.io</strong>
        </MDBNavbarBrand>
        {!this.state.isWideEnough && <MDBNavbarToggler onClick={this.onClick} />}
        <MDBCollapse isOpen={this.state.collapse} navbar>

          {navigation}

        </MDBCollapse>
        <button

        onClick={() => {
          this.setState({contacts:!this.state.contacts});

        }}
        >
        Hide
        </button>
      </MDBNavbar>

          </div>

    );
  }
}

export default Header;
